import {useState, useEffect} from 'react'




function Profile({username}) {

    const [data, setData] = useState({})

    useEffect(() => {
        fetch("/api/user/"+{username})
        .then(response => response.json())
        .then(json => setData(json))
        console.log(json)
    })





    return (
    <div className="div">
      <div id="darkened">
        <div id="head">

              <h1>Code snippets!</h1>

              <h3>Newest posts</h3>


              <h2>-------------------------------------------------</h2>






        </div>       

      </div>

    </div>
    )
}

export default Profile
